import math

def find_prime_pair(N):

    def is_prime(n):
        if n <= 1:
            return False
        if n == 2:
            return True
        if n % 2 == 0:
            return False
        for i in range(3, int(math.sqrt(n)) + 1, 2):
            if n % i == 0:
                return False
        return True
    if N <= 2:
        return [-1, -1]
    if is_prime(N - 2) and N - 2 > 0:
        return [2, N - 2]
    for i in range(3, N // 2 + 1, 2):
        if is_prime(i) and is_prime(N - i):
            return [i, N - i]
    return [-1, -1]

